import { graphql, Link } from "gatsby"
import Layout from "../components/layout"
import { convertCategory, mergePosts } from "../utilFunction"
// import { useNavigate } from 'react-router-dom';
import { ContentsListHeader, ContentsOrderedListWrapper } from "../style"
import { GatsbyImage } from "gatsby-plugin-image"

const Search = ({ data, location }: {data: any, location: Location}) => {
  const posts = mergePosts(data.allMdx, data.allWpPost, data.allFile)

  const [state, setState] = useState({
    filteredData: [] as CommonPost[],
    query: "",
  })
  // const [urlParam, setUrlParam] = useState('');
  // const navigate = useNavigate();
  //
  // useEffect(() => {
  //   // ユーザーの入力があるたびにURLのクエリパラメータを更新
  //   const params = new URLSearchParams();
  //   if (query) {
  //     params.append('q', query);
  //   } else {
  //     params.delete('q');
  //   }
  //   navigate(`?${params.toString()}`, { replace: true });
  // }, [urlParam, navigate]);

  function handleInputChange(event: React.ChangeEvent<HTMLInputElement>) {
    const queryWords = event.target.value.toLowerCase().split(/\s+/)

    const filteredData = posts.filter(post => {
      for (const word of queryWords) {
        if (!post.title.toLowerCase().includes(word) && !post.description?.toLowerCase().includes(word)) {
          return false
        }
      }
      return true
    })
    setState({
      filteredData,
      query: queryWords.join(" ")
    })
  }

  const { filteredData, query } = state

  return (
    <Layout location={location}>
        <input
          type="text"
          aria-label="Search"
          placeholder="検索ワードを入力..."
          onChange={handleInputChange}
        />
        <div className="result-inner__res">
          {query !== "" ?
            query + " の検索結果: " + filteredData.length + "件"
            : filteredData.length + "件の記事があります"
          }
        </div>
        <ContentsListHeader>
          <h1>サイト内検索</h1>
          <p>{filteredData.length} 記事あります</p>
        </ContentsListHeader>
        <ContentsOrderedListWrapper>
          {filteredData.map(post => {
            return (
              <li key={post.slug}>
                <article
                  className="post-list-item"
                  itemType="http://schema.org/Article"
                >
                  <Link to={`/${convertCategory(post.category)}/${post.slug}`}>
                    <h2>
                      <span>{post.title}</span>
                    </h2>
                    <section>
                      <div><small>
                        <time>{post.date}</time>
                      </small></div>
                      <div className="thumbnail">
                        {typeof post.gatsbyImage === "undefined" ||
                          <GatsbyImage alt={post.altText} image={post.gatsbyImage} className="thumbnail" />
                        }
                      </div>
                      <p
                        dangerouslySetInnerHTML={{ __html: post.excerpt }}
                      />
                    </section>
                  </Link>
                </article>
              </li>
            )
          })}
        </ContentsOrderedListWrapper>
    </Layout>
  )
}

export default Search

export const pageQuery = graphql`
  query {
    allMdx {
      nodes {
        body
        fields {
          slug
        }
        frontmatter {
          title
          date(formatString: "YYYY/MM/DD")
          description
          featuredImagePath
          category
        }
      }
    }
    allWpPost {
      nodes {
        title
        content
        slug
        date(formatString: "YYYY/MM/DD")
        featuredImage{
          node{
            altText
            gatsbyImage(
              width: 100,
              height: 100
              formats: [AUTO, WEBP, AVIF]
              placeholder: BLURRED
            )
          }
        }
        categories {
          nodes {
            name
          }
        }
      }
    }
    allFile(
      filter: {
        sourceInstanceName: { eq: "images" }
      }
    ) {
      edges {
        node {
          relativePath
          childImageSharp {
            gatsbyImageData(
              width: 100,
              height: 100
              formats: [AUTO, WEBP, AVIF]
              placeholder: BLURRED
            )
          }
        }
      }
    }
  }
  `"],"names":["_ref","data","location","posts","mergePosts","allMdx","allWpPost","allFile","state","setState","useState","filteredData","query","React","Layout","type","placeholder","onChange","event","queryWords","target","value","toLowerCase","split","filter","post","word","_post$description","title","includes","description","join","className","length","ContentsListHeader","ContentsOrderedListWrapper","map","key","slug","itemType","Link","to","convertCategory","category","date","gatsbyImage","GatsbyImage","alt","altText","image","dangerouslySetInnerHTML","__html","excerpt"],"sourceRoot":""}
